import './App.css';
import { BrowserRouter as Router, Route, Routes, createBrowserRouter } from 'react-router-dom';


function App(){

  const route = createBrowserRouter([
    {
      path:"/",
      element:"Home Page",
    },
    {
      path:"/add",
      element:"User Add Page",
    },
    {
      path:"/edit",
      element:"Update User Page",
    },
  ])
}

export default App;
